import React from 'react';  // React 불러오기
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Router 관련 불러오기
import Group from './group/grouproup';   // Group 컴포넌트를 불러옵니다.
import Post from './post/postost';      // Post 컴포넌트를 불러옵니다.
import Comment from './comment/commentomment'; // Comment 컴포넌트를 불러옵니다.
import Badges from './badges/badgesadges';    // Badges 컴포넌트를 불러옵니다.
import Home from './pages/home';         // Home 페이지 불러오기
import PublicGroupList from './pages/PublicGroupList'; // 그룹 목록 페이지 불러오기
import GroupDetail from './pages/GroupDetail';        // 그룹 상세 페이지 불러오기
import GroupCreate from './pages/GroupCreate';        // 그룹 생성 페이지 불러오기
import PasswordInput from './pages/PasswordInput';    // 비밀번호 입력 페이지 불러오기

function App() {
  return (
    <Router>
      <div>
        <h1>Toy Project</h1>  {/* 프로젝트 제목 */}

        {/* 라우팅을 통해 각 페이지 이동 */}
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/groups" component={PublicGroupList} />
          <Route path="/groups/:id" component={GroupDetail} />
          <Route path="/create-group" component={GroupCreate} />
          <Route path="/password-input" component={PasswordInput} />
        </Switch>

        {/* 컴포넌트들 렌더링 */}
        <Group />   {/* Group 컴포넌트 렌더링 */}
        <Post />    {/* Post 컴포넌트 렌더링 */}
        <Comment /> {/* Comment 컴포넌트 렌더링 */}
        <Badges />  {/* Badges 컴포넌트 렌더링 */}
      </div>
    </Router>
  );
}

export default App;  // App 컴포넌트를 내보내기
